import { useTranslation } from "react-i18next";

const generateItems = (t) => {
  return [
    { id: Math.random(), title: t("items.0.title"), description: " ", price: " ", category: t("items.0.category"), imgUrl: "1.png" },
    { id: Math.random(), title: " ", description: " ", price: " ", category: "", imgUrl: "2.png" },
    { id: Math.random(), title: " ", description: " ", price: " ", category: "", imgUrl: "3.png" },
    { id: Math.random(), title: "  ", description: " ", price: " ", category: "", imgUrl: "2.png" },
    { id: Math.random(), title: "", description: " ", price: " ", category: "", imgUrl: "1.png" },
    { id: Math.random(), title: "", description: " ", price: " ", category: "", imgUrl: "3.png" },
    { id: Math.random(), title: " ", description: " ", price: " ", category: "", imgUrl: "3.png" }
  ];
};

export const MyComponent = () => {
  const { t } = useTranslation();
  const items = generateItems(t);
}
